DROP TABLE IF EXISTS `tms_ivmt_mast_hist`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tms_ivmt_mast_hist` (
  `cod_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `cod_ivmt_no` varchar(64) NOT NULL COMMENT '投资记录编号',
  `cod_prod_no` varchar(64) NOT NULL COMMENT '产品编号',
  `cod_ivmt_type` int(11) DEFAULT NULL COMMENT '投资方式 1自动、2预约，4手动',
  `cod_prod_unit` int(11) DEFAULT NULL COMMENT '投资单位继承自投资产品 1.份数 2.金额',
  `cod_ivmt_propotion` decimal(19,16) DEFAULT NULL COMMENT '投资占比：投资总额/项目金额',
  `cod_ivmt_unit` int(11) DEFAULT NULL COMMENT '如果投资单位是1.份数，需要填写投资的具体份数；如果投资单位是2.金额，则保持该值为0；',
  `amt_distribution` decimal(16,2) DEFAULT NULL COMMENT '分配金额：原始投资金额',
  `amt_ivmt_total` decimal(16,2) DEFAULT NULL COMMENT '如果投资的单位是1.份数，需要根据份数金额和份数计算出投资金额；如果投资的单位是2.金额，则直接填写。',
  `amt_ivmt_principal` decimal(16,2) DEFAULT NULL COMMENT '减去优惠的实际投资者出资金额',
  `amt_receive_principal` decimal(16,2) DEFAULT NULL COMMENT '这里填写针对该笔投资，截止目前总共收回的出资金额。如果是贷款指已经回收的本金金额，如果是活期则指提前退出部分本金，如果是转让指',
  `amt_profit_expect` decimal(16,2) DEFAULT NULL COMMENT '如果是贷款指当前计息总额，如果是活期，指当天实际收益',
  `amt_total_estimate` decimal(16,2) DEFAULT NULL COMMENT '预计收益总额：如果是贷款指到期后可获得多少收益，如果是活期则不计算',
  `amt_profit_actual` decimal(16,2) DEFAULT NULL COMMENT '客户投资某产品后截止当前的实际收益总额：如果是贷款指当天已经获得利息等结算到客户账号中的金额，如果是活期指到当天为止已经获得的收益金额',
  `amt_profit_additional` decimal(16,2) DEFAULT NULL COMMENT '客户投资某产品后截止当前的额外收益总额，用于记录客户转让时的调增调减金额；是指卖出价－买入价',
  `amt_service_charge` decimal(16,2) DEFAULT NULL COMMENT '投资手续费金额',
  `amt_profit_adjust` decimal(16,2) DEFAULT NULL COMMENT '调整收益金额：溢价转让后，新客户认购时计算出调整收益金额，比如A转让时调增10元，B购买时B的调整收益金额就为-10元，B转让时调增10元，C购买时，B的调整收益金额就为10元，C的调整收益金额为-20.',
  `amt_adjust` datetime DEFAULT NULL COMMENT '调整金额：溢价时客户调增或调减的每份实际金额。',
  `amt_profit_recover` decimal(16,2) DEFAULT NULL COMMENT '回收金额：转让后当有人认购时，计算出所有收回金额；到期时，计算出所有回收金额；',
  `amt_sum_extra_source` decimal(16,2) DEFAULT NULL COMMENT '优惠金额合计',
  `amt_rat_sum_extra_source` decimal(8,5) DEFAULT NULL COMMENT '优惠利率合计',
  `amt_transfer` decimal(16,2) DEFAULT NULL COMMENT '投资成功后，如果该产品的投资单位是2.金额，如果该产品允许客户进行转让，则在到期前可以转让已投资的金额，这里则必须填写转让的金额，默认为客户购买的所有金额，份数不得小于1或大于已投资的金额。',
  `amt_trade` decimal(16,2) DEFAULT NULL COMMENT '已交易金额',
  `cod_cust_id` varchar(32) DEFAULT NULL COMMENT '投资人编号(客户编号)',
  `cod_acct_no` varchar(32) DEFAULT NULL COMMENT '投资人账号，用于结算时传给核心用于入账',
  `dat_ivmt` datetime DEFAULT NULL COMMENT '投资时间',
  `cod_trsf_portion` int(11) DEFAULT NULL COMMENT '投资成功后，如果该产品的投资单位是1.份数，如果该产品允许客户进行转让，则在到期前可以转让已投资的部分，这里则必须填写转让的份数，默认为0。',
  `cod_trade_portion` int(11) DEFAULT NULL COMMENT '已交易份数',
  `cod_trsf_count` int(11) DEFAULT NULL COMMENT '初始值为0，在发生转让交易的时候累计加一，用于记录该笔投资的转让次数，主要用于记录部分转让次数，保留字段将来有需求控制部分转让次数时所用。',
  `cod_freeze_no` int(11) unsigned DEFAULT NULL COMMENT '冻结编号',
  `dat_calculation` datetime DEFAULT NULL COMMENT '收益计算日期，和产品表中上一计算日期一样。',
  `dat_distribution` datetime DEFAULT NULL COMMENT '收益分配日期，和产品表中上一分配日期一样。',
  `cod_channel_id` varchar(5) DEFAULT NULL COMMENT '渠道编号',
  `cod_user_ref` varchar(64) DEFAULT NULL COMMENT '渠道流水',
  `cod_txn_ref` varchar(64) DEFAULT NULL COMMENT '交易流水',
  `dat_create` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `cod_create_user` varchar(32) NOT NULL COMMENT '创建人员',
  `cod_create_org` varchar(32) NOT NULL COMMENT '创建机构',
  `dat_modify` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '维护时间',
  `cod_modify_user` varchar(32) NOT NULL COMMENT '维护人员',
